=head1 NAME

Bio::RNA::SpliceSites::Scoring::SpliceModels::me2x3acc - 3' splice site data submodule for  pre-mRNA splice site scoring by the maxEntScan algorithm of Gene Yeo and Chris Burge.

=head1 SYNOPSIS

#This module is not intended for direct use, instead 3'ss scoring should be called through the Bio::RNA::SpliceSites::Scoring::MaxEntScan module, which uses this data submodule for splice site scoring.

=head1 DESCRIPTION

This module contains a preparsed data structure for 3'ss scoring by the maxEntScan algorithm of Yeo and Burge.

=head2 EXPORT

None.

=head1 SEE ALSO

Bio::RNA::SpliceSites::Scoring::MaxEntScan

The data contained within this data submodule originated with the maxEntScan programs distributed by Chris Burge, PhD and Gene Yeo, PhD.  

J Comput biol. 2004;11(2-3):377-94
Maximum entropy modeling of short sequence motifs with applications to RNA splicing signals.
Yeo G, Burge CB
